import { Link } from 'react-router-dom';
import Header from '../components/header';
import aircallgif from '../assets/aircallgif.gif';
import { Icon } from '@iconify/react';

const Checkout = () => {
	return (
		<div className="absolute flex flex-col items-center justify-center left-0 top-0 right-0 bottom-0">
		<div className="w-96 h-fit z-100 bg-white shadow-lg p-2 pt-6 ">
		  <div className='w-full flex justify-around'>
		    <Icon icon="mingcute:left-line" color="#6d30ed" className='basis-1/8 -ml-10' width="24" height="24" />		    
		    <p className='font-bold text-mid-black text-lg justify-center basis-1/2'>Checkout</p>
		  </div>
		  <div className="flex flex-col justify-center p-4 mt-2">
			<p className='text-dark-gray font-semibold'>Delivery Details</p>
			<div className='w-40 text-dark-gray font-semibold bg-light-gray rounded mt-4 flex'>
				<Icon icon="ion:location-outline" color="#6d30ed" width="24" height="24" />
				<span className='text-sm '>15, Yemen Road, Yemen</span>
			</div>
			<p className='text-dark-gray font-semibold'>Delivery Details</p>

		  </div>
		  <Link to='/phone'>
			<div className='w-full flex justify-center'>
			<button className={'bg-app-green text-white mt-12 mb-8 px-6 py-2 rounded-lg hover:shadow-xl hover:scale-105'}>
					Let's Get Started!
			</button>
			</div>
		  </Link>
		</div>
	  </div>
	);
};

export default Checkout;
